import React from 'react';

function Footer() {
    const icons = [
        {
            name: 'github',
            links: '',
        },
        {
            name: 'instagram',
            links: '',
        },
        {
            name: 'tiktok',
            links: '',
        }
    ]

    return (
        <footer>
            {icons.map(icon => {
                return <a href={icon.link} key={icon.name} target='_blank'></a>
            })}
        </footer>
    )
}


export default Footer;
